    "name" : "initializeDispatchProperty"
    "qualifiedname" : "_interceptors.initializeDispatchProperty"
    "comment" : "<p>Initializes the <code>getDispatchProperty</code> function and <code>dispatchPropertyName</code> variable.  Each isolate running in a web page needs a different <code>dispatchPropertyName</code>, so if a given dispatch property name is in use by some other program loaded into the web page, another name is chosen.</p> <p>The non-CSP version is called like this:</p> <pre><code>initializeDispatchProperty(     function(x){$.getDispatchProperty=x},     '_f4$Dxv7S',     $.Interceptor); </code></pre> <p>The <code>getDispatchProperty</code> function is generated from the chosen name of the property.</p> <p>The CSP version can't create functions via <code>new Function(...)</code>, so it is given a fixed set of functions to choose from.  If all the property names in the fixed set of functions are in use, it falls back on the definition of <code>getDispatchProperty</code> above.</p> <pre><code>initializeDispatchPropertyCSP(     function(x){$.getDispatchProperty=x},     [function(a){return a._f4$Dxv7S},      function(a){return a._Q2zpL9iY}],     $.Interceptor); </code></pre>"
