  "Interceptor" : 
    "name" : "Interceptor"
    "qualifiedname" : "_interceptors.Interceptor"
    "comment" : "<p>The base interceptor class.</p> <p>The code <code>r.foo(a)</code> is compiled to <code>getInterceptor(r).foo$1(r, a)</code>.  The value returned by <code>getInterceptor</code> holds the methods separately from the state of the instance.  The compiler converts the methods on an interceptor to take the Dart <code>this</code> argument as an explicit <code>receiver</code> argument.  The JavaScript <code>this</code> parameter is bound to the interceptor.</p> <p>In order to have uniform call sites, if a method is defined on an interceptor, methods of that name on plain unintercepted classes also use the interceptor calling convention.  The plain classes are <em>self-interceptors</em>, and for them, <code>getInterceptor(r)</code> returns <code>r</code>.  Methods on plain unintercepted classes have a redundant <code>receiver</code> argument and should ignore it in favour of <code>this</code>.</p> <p>In the case of mixins, a method may be placed on both an intercepted class and an unintercepted class.  In this case, the method must use the <code>receiver</code> parameter.</p> <p>There are various optimizations of the general call pattern.</p> <p>When the interceptor can be statically determined, it can be used directly:</p> <pre><code>CONSTANT_INTERCEPTOR.foo$1(r, a) </code></pre> <p>If there are only a few classes, <code>getInterceptor</code> can be specialized with a more efficient dispatch:</p> <pre><code>getInterceptor$specialized(r).foo$1(r, a) </code></pre> <p>If it can be determined that the receiver is an unintercepted class, it can be called directly:</p> <pre><code>r.foo$1(r, a) </code></pre> <p>If, further, it is known that the call site cannot call a foo that is mixed-in to a native class, then it is known that the explicit receiver is ignored, and space-saving dummy value can be passed instead:</p> <pre><code>r.foo$1(0, a) </code></pre> <p>This class defines implementations of <em>all</em> methods on <code>Object</code> so no interceptor inherits an implementation from <code>Object</code>.  This enables the implementations on Object to ignore the explicit receiver argument, which allows dummy receiver optimization.</p>"
